import React from "react";
import SearchBar from "../searchBar/SearchBar";
import Rick1 from "../nav/img/Rick1.png"
import { NavLink } from "react-router-dom";

export default function Nav(props) {
    return (
        <div>
            <img style={{ height: '300px' }} src={Rick1} alt="Rick and Morty" />
            <SearchBar onSearch={props.onSearch} />
            <div>
                <NavLink to="/about" activeClassName="active-link">
                    <button>About</button>
                </NavLink>
                <NavLink to="/home" activeClassName="active-link">
                    <button>Home</button>
                </NavLink>
            </div>
        </div>
    );
}

// Crea dos botones. Uno con el texto "About" y que te redirija a /about, y otro con el texto "Home" que te redirija a /home.
// [NOTA]: podrías utilizar NavLink para darle estilos al link About y Home.
